description:
The Mating Game

Nature Documentary hosted by David Attenborough, published by BBC broadcasted as part of BBC Natural World series in 2013 - English narration


Information
------------------------------

David Attenborough narrates the charming and fascinating story of some real-life animal romantics. There are show-offs and singers, dancers and fighters, stories of undercover affairs and heart-warming devotion. These include a male polar bear that plays hard to get, a lemur whose odour bags him a mate and a lizard who is tender and faithful to the very end.
It reveals that animals can be loving, complex, funny and inventive - it is all part of the mating game.

